import styled from "styled-components"

export const Title = styled.h1`
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    position: absolute;
`;

export const Header = styled.div`
    background: red;
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
`;

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;
export const Container1 = styled.div`
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 102px;
    background: red;
    border-radius: 16px;
`;
export const Text1 = styled.text`
    position: absolute;
    width: 51px;
    height: 18px;
    left: 75px;
    top: 15px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;
export const Container2 = styled.div`
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 162px;
    background: red;
    border-radius: 16px;
`;
export const Text2 = styled.div`
    position: absolute;
    width: 85px;
    height: 18px;
    left: 75px;
    top: 15px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;
export const Container3 = styled.div`       
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 222px;
    background: red;
    border-radius: 16px;
`;
export const Text3 = styled.div`
    position: absolute;
    width: 43px;
    height: 18px;
    left: 75px;
    top: 15px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;
export const Container4 = styled.div`       
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 282px;
    background: red;
    border-radius: 16px;
`;
export const Text4 = styled.div`
    position: absolute;
    width: 161px;
    height: 18px;
    left: 75px;
    top: 15px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;
export const Title1 = styled.h1`
    position: static;
    width: 34px;
    height: 24px;
    left: 171.5px;
    top: 730px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 24px;
    color: #FFFFFF;
    flex: none;
    order: 0;
    flex-grow: 0;
    margin: 0px 10px;
    justify-content: center;
`;
export const Button1 = styled.button`
    justify-content: space-between;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius:99px;
    position: absolute;
    top:585px;
    width: 315px;
    height: 60px;
    left:31px;
    display: flex;
    flex-direction: row;
    align-items: flex-start;
    padding: 18px 129px;
    box-shadow: 0px 10px 22px rgba(149, 173, 254, 0.3);
    border: none;
`;
export const Container5 = styled.div`
    background: linear-gradient(274.42deg, #C58BF2 0%, #EEA4CE 124.45%);
    border-radius: 50px;
    position: absolute;
    width: 44px;
    height: 24px;
    left: 260px;
    top: 70px;
`;
